  ('bOleri', 's.', NULL, NULL, 'Cl. 2', NULL, 'sing. víctima. Cl. I. boleri, pret. v. o bóléla ; e puá e e sinoke o bokobbe el perro masticó para el cachorro el plátano. bóleseei. pret. v. o bóléa ; a batyo ba - la ketya las per sonas se abanicaban con helechos. bolessi, pret. v. o bolla ; e bihMma bi - e esubba los frutos se pudrían en la época lluviosa. bOlessi, 1. pret. v. o boláa ; e somíoko si - el gallo can taba. 2. pret. v. o bollá ; o bohiárúppe a le - e bilabba bi á o bokonno el sacerdote me decía las cosas del MArs. bolessi, pret. v. o bólláa ; n - masticaba, o - masticabas, a - masticaba, to - masticába mos, lo - masticabais, ba - masticaban. bólessi. pret. v. o bólláa ; a batyo ba - i húúa las personas aba nicaban al público', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
