  ('bollá', 's.', NULL, NULL, 'Cl. 2', NULL, 'sing. niño, hijo, muchacho, chaval, crío, prole. CI. 1. bolla, v. pudrirse, fermentarse. Pret. bori, bolessi. Tb. o booa. bollá, v. decir, notificar, avisar. Pret. borí, bOléssi. lb. o túbaera', NULL, 'boláe', 'Fuente: bubi-español', 'import-script'),
  ('bolláa', 's.', NULL, NULL, 'Cl. 1', NULL, 'sing. portador, acarreador. . bolláa, 1. s. sing. follón, jaleo. . 2. -, v. cantar el gallo, piar. Pret. boríi, boléssi. bolláa, v. masticar, rumiar; n la - pokomma mastico granos del paraíso. Pret. bOríi, bóléssi. bólláa, v. abanicar; o oberíi a la - o bOllá la madre abanica al niño. Pret. bóríi, bóléssi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
